import './imageContainer.css';

const ImgShow=({imgUrl})=>{
if (imgUrl.length>0){

  return (<div>

    <img src={imgUrl} alt="Human" height='400px' width='auto' className='br4 pt2 imageContainer'/>
  </div>);
}
return (<div></div>);

}
export default ImgShow;
